    RECOMMEND:
      "\tРежим дня предполагает оптимальную двигательную активность и полноценный отдых. Продолжительность сна должна составлять 8-9 часов. После 19:30 ограничить эмоциональные нагрузки (шумные игры, просмотр фильмов, игры на компьютере и телефоне), за 2 часа до сна исключить использование мобильного телефона. Непрерывная длительность занятий с персональным компьютером не должна превышать 30 минут, а общая длительность занятий – 2-х часов в день. Занятия физической культурой в развивающем режиме в аэробно-анаэробной зоне, ЧСС 155-180 уд/мин. Желательны контрастный душ и дыхательные практики. Необходимо обеспечить разнообразное и полноценное питание с ограничением продуктов, усиливающих метеоризм ((острые блюда, лук, чеснок, маринады, чипсы, ржаной хлеб, бобовые, избегать избытка мучных продуктов, сладостей). Рекомендуется включать продукты функционального питания, содержащих в своем составе пробиотики и пребиотики (кисломолочные продукты, квашенная капуста, сыры, бананы, яблоки, ягоды, цикорий, коричневый рис, овсяные отруби), витамины, минералы и полиненасыщенные жирные кислоты",
    END_REC:
      "\tДля укрепления сердечно-сосудистой системы, опорно-двигательного аппарата и снижения риска неинфекционных заболеваний рекомендуется ежедневные занятия физической активностью не менее 60 минут, при этом  большая часть ежедневной физической активности должна приходиться на циклические упражнения, направленные на развитие выносливости, к которым относятся: бег с чередованием ходьбы, бег, плавание, езда на велосипеде, катание на коньках, нагрузка на велотренажере, ходьба на лыжах, гребля, ритмическая гимнастика.\n\tПри выполнении физических упражнений аэробного характера частота сердечных сокращений должна быть в пределах от 149 до 170 уд./мин.",
