    RECOMMEND:
      "\tРежим дня должен предусматривать достаточный объем двигательной активности. Продолжительность сна должна составлять не менее 8 часов. После 20 часов ограничить эмоциональные нагрузки (шумные игры, просмотр фильмов, игры на компьютере и телефоне), за 2 часа до сна исключить использование мобильного телефона. Непрерывная длительность занятий с персональным компьютером не должна превышать 30 минут, а общая длительность занятий – 2-х часов в день. Занятия физической культурой (двигательные нагрузки без ограничений). Рациональное питание предусматривает кратность приема пищи не менее 4-5 раз в день. Ограничиваются продукты, усиливающие секрецию пищеварительных желез, а также продукты, вызывающие метеоризм (острые блюда, лук, чеснок, маринады, чипсы, ржаной хлеб, бобовые, избегать избытка мучных продуктов, сладостей). Необходим достаточный, но не чрезмерный питьевой режим",
    END_REC:
      "\tДля укрепления сердечно-сосудистой системы, опорно-двигательного аппарата и снижения риска неинфекционных заболеваний рекомендуется ежедневные занятия физической активностью не менее 60 минут, при этом  большая часть ежедневной физической активности должна приходиться на циклические упражнения, направленные на развитие выносливости, к которым относятся: бег с чередованием ходьбы, бег, плавание, езда на велосипеде, катание на коньках, нагрузка на велотренажере, ходьба на лыжах, гребля, ритмическая гимнастика.\n\tПри выполнении физических упражнений аэробного характера частота сердечных сокращений должна быть в пределах от 148 до 170 уд./мин.",
