      "\tСуществующие условия учебной деятельности и бытовые условия способствуют поддержанию оптимального функционального состояния. Сохранение режима дня и питания, рациональное сбалансированное питание. Двигательные нагрузки без ограничений",
    END_REC:
      "\tДля укрепления сердечно-сосудистой системы, опорно-двигательного аппарата и снижения риска неинфекционных заболеваний рекомендуется ежедневные занятия физической активностью не менее 60 минут, при этом  большая часть ежедневной физической активности должна приходиться на циклические упражнения, направленные на развитие выносливости, к которым относятся: бег с чередованием ходьбы, бег, плавание, езда на велосипеде, катание на коньках, нагрузка на велотренажере, ходьба на лыжах, гребля, ритмическая гимнастика.\n\tПри выполнении физических упражнений аэробного характера частота сердечных сокращений должна быть в пределах от 148 до 170 уд./мин.",
